[ScoreHD] Angelina Castro (Teaching the Carpet Cleaner a Lesson / 12.17.2013)

Angelina Castro has a dirty rug. Not like that! It's an antique she inherited from her grandmother, and now it's time for it to be professionally cleaned. Her friends all told her there was only one man for the job. &quot;As long as he doesn't get my rug even dirtier,&quot; she thinks, &quot;it'll be better than I could do.&quot; When he arrives she gives him the instructions, but can't shake the feeling that when she looks away he's staring...

